import path from 'path';

export default async function(page, fileUrl, screenshotsDir) {
  try {
    // Navigate to the HTML file
    await page.goto(fileUrl);
    await page.waitForLoadState('networkidle');

    // Take initial screenshot
    const screenshots = [];
    await page.screenshot({ path: path.join(screenshotsDir, 'step_1_initial.png') });
    screenshots.push(path.join(screenshotsDir, 'step_1_initial.png'));

    // Locate and click the cart element using a text-based selector
    // The element contains text like "0 Cart"
    const cartButton = page.locator('div.cart');
    await cartButton.waitFor({ state: 'visible', timeout: 5000 });
    await cartButton.click();

    // Wait for the modal to become visible. Since the cart is empty,
    // we expect to see the "empty-cart" message.
    const emptyCartLocator = page.locator('.empty-cart');
    await emptyCartLocator.waitFor({ state: 'visible', timeout: 5000 });

    // Take a screenshot of the opened modal
    await page.screenshot({ path: path.join(screenshotsDir, 'step_2_cart_modal_visible.png') });
    screenshots.push(path.join(screenshotsDir, 'step_2_cart_modal_visible.png'));

    // Extract the text from the modal to verify it opened correctly
    const modalText = await emptyCartLocator.textContent();

    return {
      success: true,
      action: "Opened the shopping cart modal",
      extractedData: {
        modalContent: modalText
      },
      screenshots,
      error: null
    };
  } catch (error) {
    // In case of an error, take a final screenshot for debugging
    if (page) {
        const errorScreenshotPath = path.join(screenshotsDir, 'error_state.png');
        await page.screenshot({ path: errorScreenshotPath });
        // The template requires an empty array on failure, but this can be useful
    }
    return {
      success: false,
      action: "Failed to open shopping cart modal",
      extractedData: {},
      screenshots: [],
      error: error.message
    };
  }
}
